function loginCtrl($scope, ghAPI, appSettings, $location) {

    $scope.tokenAttempts = 0;
    $scope.useManualToken = false;

    $scope.toggleManualToken = function() {
      $scope.useManualToken = !$scope.useManualToken;
    };

    $scope.step1 = function() {
        $scope.step2 = false;
    };

    function handleLogin(response) {
        if (response.status === 201) {
            

            appSettings.loadSettings().then(function(result) {

                appSettings.set({
                    token: response.data.token
                });
                
                window.location.href = '#/';
            });

        } else if (response.status === 401 && response.headers['x-github-otp']) {
            $scope.step2 = true;
            $scope.spinner = false;
            if ($scope.tokenAttempts === 0) {
                $('.info').slideDown();
            } else {
                $('.info').slideUp();
                $('.warn').slideDown().find('span').text('Authenticator token incorrect');
            }
            
        } else {
            $scope.spinner = false;
            
            $('.warn').slideDown('slow');
            $('.warn span').text('Log-in failed - server responded with error');
            setTimeout(function () {
                $('.warn').slideUp();
            }, 2500);
        }
    }

    $scope.submit = function () {
        $scope.spinner = true;
        if ($scope.code) {
            $scope.tokenAttempts++;
        }
        ghAPI.login($scope.user, $scope.pass, handleLogin, $scope.code);
    };

    $scope.manualLogin = function() {

        ghAPI.isTokenValid($scope.manualToken).then(function() {
            // token is valid save and redirect to homepage
            appSettings.loadSettings().then(function(result) {
               appSettings.set({
                   token: $scope.manualToken
               });
               $location.url('/');
            });

        }, function(error) {
            $('.warn').slideDown('slow');
            $('.warn span').text('Log-in failed - Token is invalid');
            setTimeout(function () {
                $('.warn').slideUp();
            }, 2500);
        });

    };
}
'use strict';

function mainCtrl($scope, $http, appSettings) {

    appSettings.loadSettings().then(function(result) {
        $scope.latestVersion = appSettings.get('latestVersion');
        
    });



    $scope.currentVersion = '';
    $scope.updateAvailable = false;

    $scope.gotoSite = function () {
        gui.Shell.openExternal('http://www.gistoapp.com');
    };

    // get the current version number
    $http.get('./package.json').success(function (data) {
        $scope.currentVersion = data.version;
        
    });

    var timestamp = new Date().getTime() - 86400000; // 1 day ago
    if (!$scope.latestVersion || $scope.latestVersion.timestamp < timestamp) {
        
        // get the latest version number
        $http({
            url: 'https://api.github.com/repos/Gisto/Gisto/contents/app/package.json',
            headers: {
                Accept: "application/vnd.github.3.raw"
            },
            method: 'get'
        }).success(function (data) {
                
                appSettings.loadSettings().then(function(result) {

                    $scope.latestVersion = {
                        version: data.version,
                            timestamp: new Date().getTime()
                    };

                    appSettings.set($scope.latestVersion);

                }, function(error) {
                    
                });

            });

    }

    $scope.$watch('currentVersion + latestVersion', function () {
        
        if ($scope.currentVersion && $scope.latestVersion && $scope.currentVersion !== $scope.latestVersion.version) {
            $scope.updateAvailable = true;
        }
    });
}
