angular.module('gisto.directive.editor', []).directive('editor', function ($timeout,$rootScope) {
        var editorWindow = angular.element('<pre id="editor-{{$index}}">{{file.content}}</pre>');
    return {
        restrict: 'E',
        compile: function (elem) {
            elem.append(editorWindow);

            return function (scope, element, attrs) {

                $timeout(function () {

                    var lang = attrs.language,
                        font = +attrs.font,
                        editor = ace.edit('editor-' + attrs.index),
                        theme = attrs.theme;


                    editor.setTheme("ace/theme/" + theme);
                    editor.getSession().setMode("ace/mode/" + lang);
                    editor.setFontSize(font);
                    editor.setShowPrintMargin(false);
                    editor.setAutoScrollEditorIntoView(true);

                    function fitSize() {
                    var newHeight =
                        editor.getSession().getScreenLength()
                            * editor.renderer.lineHeight
                            + editor.renderer.scrollBar.getWidth();

                    $('pre#editor-' + attrs.index).height(parseInt(newHeight.toString()) + "px");
                    editor.resize(true);
                    }

                    fitSize();

                    
                    
                    

                    editor.on('change', function (data) {
                        fitSize();
                        scope.$apply(function () {
                            scope.file.content = editor.getValue();
                            if (!scope.edit) {
                                scope.enableEdit();
                            }
                        });
                    });

                }, 0);
            };
        }

    };
});
